#include <iostream>
#include <string>
#include <vector>
#include <cmath>

using namespace std;
int main(){
    string str = "";
    vector<int> v = {0, 1, 0, -1};
    for(int k = 0; k < 100; k++) {
        string str2 = str;
        for (int i = 1; i <= str.length(); i++) {

            int n = 0;
            for (int j = i-1; j < str.length(); j++) {
                n += (str[j] - '0') * v[((j + 1) / i) % 4];

            }
            str2[i-1]= (char)('0'+abs(n)%10);

        }

    }
    cout<<str;
    return 0;
}
